(function () {
const applicationApi = window.UWF.API.ApplicationState.init();
const languageApi = window.UWF.API.Language.init();
const broadcastApi = window.UWF.API.Broadcast.init();
const logApi = window.UWF.API.Log.init();

const pendoIntegration = applicationApi.getClientIntegration('pendo-client-integration') || {};
const pendoVariables = pendoIntegration.variables || {};
const pendoConfig = pendoIntegration.config || {};
const pendoApiKey = pendoVariables.API_KEY;
const currentApplicationName = applicationApi.getCurrentApplicationName();

if (!pendoApiKey) {
    logApi.warn({clientIntegration: "Pendo", message: "no API_KEY available: not injecting Pendo script", pendoIntegration});
    return;
}

