    },
    events: {
        ready: function () {
            logApi.debug({clientIntegration: "Pendo", message: "initialised and ready"});
        },
        guidesLoaded: function() {
            logApi.debug({clientIntegration: "Pendo", message: "guides are loaded"});
            const pendoResourceCenterContainer = "pendo-resource-center-container";

            // clean up any previous resource center instances on startup
            pendo.BuildingBlocks.BuildingBlockResourceCenter.dismissResourceCenter();

            // function to hide resource center when outside of resource center and its descendants
            // https://github.com/pendo-io/snippets/blob/master/resourceCenter/dismissRCWhenClickOutsideTargetElementRC/dismissRCWhenClickOutsideTargetElementRC.js
            const hideResourceCenter = e => {
                let tgt = e.target;
                let path = e.composedPath();
                let resourceCenterDescendant = false;
                for (let i = 0; i < path.length; i++) {
                    if (path[i].id === pendoResourceCenterContainer) {
                        resourceCenterDescendant = true;
                    };
                };
                if (pendo.dom(`#${pendoResourceCenterContainer}`).length && !resourceCenterDescendant && !pendo.dom(tgt).closest(pendo.BuildingBlocks.BuildingBlockResourceCenter.getResourceCenter().steps[0].elementPathRule).length) {  
                    pendo.stopGuides();  
                };
            };

            // set zIndex to 1 so resource center does not appear above application elements
            // pendoResourceCenterContainer is only available when resource center guide is open
            // gets reset each time resource center is dismissed, so we cannot remove the eventListener
            // suitable pendo api events not available to update when resource center guide is open
            const updateResourceCenterZIndex = e => {
                if (pendo.dom(`#${pendoResourceCenterContainer}`).length) {
                    document.getElementById(pendoResourceCenterContainer).style.zIndex = "1";
                }
            };

            // subscribe to broadcastApi event to execute code only when top bar is loaded
            broadcastApi.subscribe(`${currentApplicationName}.support-link.available`, data => {
                logApi.debug({clientIntegration: "Pendo", message: "support link is available", elementId: `${data.elementId}`, iconUri: `${data.iconUri}`});

                // we check if the support icon is targeted by Pendo by checking if the iconUri is selected
                const isIconTargetedByPendo = pendo.guides?.some(obj => obj.attributes?.activation?.selector === `.${data.iconUri}`);
                if (isIconTargetedByPendo) {
                    logApi.debug({clientIntegration: "Pendo", message: "resource center is available", currentApplicationName});

                    // addEventListener to close resource center when outside resource center and its descendants
                    document.addEventListener('mousedown', hideResourceCenter);

                    //Â addEventListener to update zIndex of resource center
                    document.addEventListener('click', updateResourceCenterZIndex);

                    // if the support icon is targeted by Pendo, we clone the button and replace the original
                    // this disables the support icon functionality (opening support url in new tab) & only opens Pendo Resource Center
                    const helpBtn = document.getElementById(`${data.elementId}`);
                    const clonedHelpBtn = helpBtn.cloneNode();
                    helpBtn.parentElement.replaceChild(clonedHelpBtn, helpBtn);
                }
            });
        },
    },
    ...pendoConfig,
    }); 
})();

